import React from "react";
import PropTypes from "prop-types";
import Pagination from "./Pagination";
import "../css/ProjectTable.css";

const ProjectTable = ({ projects, currentPage, totalPages, onPageChange }) => {
    return (
        <>
            <table className="project-table" aria-labelledby="Kickstarter Projects">
            <caption id="projectTableDescription">List of Kickstarter Projects with their funding details</caption>
                <thead>
                    <tr>
                        <th>S.No.</th>
                        <th>Percentage funded</th>
                        <th>Amount pledged</th>
                    </tr>
                </thead>
                <tbody>
                    {projects.map((project, index) => (
                        <tr key={index}>
                            <td>{project["s.no"]}</td>
                            <td>{project["percentage.funded"]}</td>
                            <td>{project["amt.pledged"]}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <Pagination
                currentPage={currentPage}
                totalPages={totalPages}
                onPageChange={onPageChange}
            />
        </>
    );
};

ProjectTable.propTypes = {
    projects: PropTypes.array.isRequired,
    currentPage: PropTypes.number,
    totalPages: PropTypes.number,
    onPageChange: PropTypes.func,
}

export default ProjectTable;
